import {useState} from 'react'
 function Profile ()
{
    const [loggedIn,setLoggedIn]=useState(false)
    if(loggedIn)
    {
        return(
            <div className="Profile">
            <h1>Welcome Arslan</h1>
            </div>
                );
    }
    else{
        return(
            <div className="Profile">
            <h1>Welcome Guest</h1>
            </div>
                );
    }
   
}
export default Profile;
